<span class="line"><span style="color:#A6ACCD;">        </span><span style="color:#676E95;font-style:italic;">&lt;!-- The endpoint Auth info,if set &quot;Basic&quot; in authInfo will use as basic Auth username &amp; password, &quot;Oauth&quot; will use as Oauth client-id&amp;client-secret  --&gt;</span></span>
